import React from "react";
import "./App.css";
import "bulma/css/bulma.css";
import Test from "./components/Test";

const App: React.FC = () => {
  return (
    <div
      style={{
        backgroundColor: "#282c34"
      }}
    >
      <Test />
    </div>
  );
};

export default App;
